column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli ஆனது JSON அமைவாக்கத் தரவு மற்றும் அமைவாக்கத்தைக் கொண்டுள்ள ஒரு கோப்புப் பெயர் ஆகிய இரண்டையும் ஏற்கும். கோப்பை வழங்கினால், கோப்பு வாசிக்கப்பட்டு அதிலுள்ளவை பண்புகளில் அமைக்கப்படும்.

எடுத்துக்காட்டுகள்: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
பயன்பாடு: nmcli general { COMMAND | help }

மதிப்புருக்கள் := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
பயன்பாடு: nmcli general status { help }

NetworkManager இன் ஒட்டுமொத்த நிலையைக் காட்டு.
'status' என்பதே முன்னிருப்பு செயல், அதாவது 'nmcli gen' ஆனது 'nmcli gen status' ஐ அழைக்கிறது எனப் பொருள்

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
பயன்பாடு: nmcli networking { COMMAND | help }

கட்டளை := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
பயன்பாடு: nmcli radio all { ARGUMENTS | help }

மதிப்புருக்கள் := [on | off]

அனைத்து ரேடியோ ஸ்விட்ச்சுகளின் நிலைகளைப் பெறு, அலல்து அவற்றை ஆன் அல்லது ஆஃப் செய்.

column1:
